import React from 'react';
import styles from './Track.module.css';

function Track({trackName, albumName, artistName}){


       return(
           <>
           <div className={styles.track}>
               <h2>{trackName}</h2>
               <p>{albumName}</p>
               <p>{artistName}</p>
           </div>
   </>
       )
}

export default Track;
